import mergeImages from 'merge-images';
import { saveAs } from 'file-saver';
import React, { useState, useEffect } from "react";
import Header from '../components/Header';
import Navigation from '../components/Navigation';
import Footer from '../components/Footer';

/*
Component that displays the various components displayed on the albums page
including the header, the navigation buttons, the image, and a button
to download the image
*/
const Album = () => {
    const [src, setSrc] = useState(null);

    /*
    Function that gets a user's top 10 songs from the backend /toptracks endpoint and puts the album JSON 
    objects into an array
    */
    const apiGet = () => {
        return new Promise(
            resolve => {
                fetch('http://localhost:8888/toptracks/', {
                    method: 'GET',
                    headers: {
                        'Access-Control-Allow-Origin': '*',
                        'Access-Control-Allow-Methods': 'GET,PUT,POST,DELETE,PATCH,OPTIONS',
                    }
                })
                    .then((response) => response.json())
                    .then(function (json) {
                        const album = [];
                        for (let i = 0; i < 10; i++) {
                            album.push(json[i].album);
                            if (i === 9) {
                                resolve(album);
                            }
                        }
                    })

            });
    }
    /*
    Function taking in url, width, and height of an image, the name of the album in that image and 
    resizes the image, adds a green border and superimposes text with the album name on the image
    It returns a promise that resolves to a base64 string
    */
    const convertAndResize = (url, name, width, height) => {

        return new Promise(
            function (resolve) {
                var img = new Image();
                img.src = url;
                img.setAttribute('crossOrigin', 'anonymous');

                img.onload = () => {
                    var canvas = document.createElement("canvas");
                    canvas.width = width;
                    canvas.height = height + 45;
                    var ctx = canvas.getContext("2d");

                    ctx.fillStyle = "green";
                    ctx.rect(0, 0, width - 10, height);
                    ctx.fill();
                    ctx.drawImage(img, 5, 5, width, height);
                    ctx.font = "18pt Courier New"
                    ctx.fillText(name, 0, height + 25, width);
                    resolve(canvas.toDataURL("image/png"));
                }
            });
    }

    //call to the apiGet function for album information
    var apicall = apiGet();

    //waits until the API call is made to put both the album images and names into arrays
    Promise.resolve(apicall).then((albums) => {
        var images = albums ? albums.map((item) => item.images[1].url) : null;
        var names = albums ? albums.map((item) => item.name) : null;

        const promises = [];

        for (var i = 0; i < 10; i++) {
            promises.push(convertAndResize(images[i], names[i], 200, 200));
        }

        // waits until all promises are resolved to merge images
        Promise.all(promises).then((values) => {
            mergeImages([
                {
                    src: "data:image/png;base64,"
                },
                {
                    src: "data:image/png;base64,",
                    x: 0,
                    y: 0
                },
                {
                    src: values[0],
                    x: 40,
                    y: 40
                },
                {
                    src: values[1],
                    x: 310,
                    y: 40
                },
                {
                    src: values[2],
                    x: 580,
                    y: 40
                },
                {
                    src: values[3],
                    x: 140,
                    y: 310
                },
                {
                    src: values[4],
                    x: 410,
                    y: 310
                },
                {
                    src: values[5],
                    x: 680,
                    y: 310
                },
                {
                    src: values[6],
                    x: 510,
                    y: 580
                },
                {
                    src: values[7],
                    x: 780,
                    y: 580
                },
                {
                    src: values[8],
                    x: 410,
                    y: 850
                },
                {
                    src: values[9],
                    x: 680,
                    y: 850
                },
                {
                    src: "data:image/png;base64,",
                    x: 650,
                    y: 920
                },

            ])
                .then((src) => setSrc(src))
                .catch(error => console.log(error))
        });
    })

    // loading placehoder image
    useEffect(() => {
        mergeImages([
            'data:image/png;base64,'], { height: 450 })
            .then((src) => setSrc(src))
            .catch(error => console.log(error))
    }, []);

    // downloads merged image as png upon button click
    const downloadImage = () => {
        saveAs(src, "album-art.png");
    }
    return (
        <div>
            <Header />
            <Navigation />
            <img className="art" src={src} alt="" ></img>
            <button className="btn2" type="button" onClick={downloadImage}>Download Image</button>
            <Footer></Footer>
        </div>
    );
}

export default Album;